export const JEWEL_COUNT = 7;

export const JewelColorHash = {
    darkred: 0,
    darkblue: 1,
    yellow: 2,
    orange: 3,
    purple: 4,
    darkgreen: 5,
    white: 6
};

export const JewelsIndexHash = [
    'darkred',
    'darkblue',
    'yellow',
    'orange',
    'purple',
    'darkgreen',
    'white'
];
